const entries = [
    {
        id: 1,
        date: "11-04-2022",
        content: "I'm feeling quite anxious because of my upcoming exam session."
    },
    {
        id: 2,
        date: "11-14-2022",
        content: "Today was a fabulous day! I attended an insightful conference and had a productive discussion with my team."
    },
    {
        id: 3,
        date: "11-18-2022",
        content: "All of my English exams are now over, so I'm feeling relieved and excited to work on my programming projects."
    }
];

export default entries;
